    for line in balloons:
        if line == 'N':
            (a, b) = (min(a, -b), max(-a, b))
        else:
            x = int(line.split(' ')[1])
            op = line[0]
            if op == '+':
                (a, b) = (min(a, a + x), max(b, b + x))
            elif op == '-':
                (a, b) = (min(a, a - x), max(b, b * x))
            elif op == '*':
                (a, b) = (min(a, a * x, b * x), max(b, a * x, b * x))
            else:
                (a, b) = (min(a, a // x, b // x), max(b, a // x, b // x))
    return b

